import React from 'react'
import './App.css';
import Explore from './Explore';
import Features from './Features';
import Homepage from './Homepage';
import IMAGES from './images/imag';
import Signin from './SignUpForm';
import {Link } from 'react-router-dom';

const Nav = () => {
        const navigate = useNavigate();
      
        const handleSignInClick = () => {
          navigate('/signUpForm');
        };
  return (
    <div>
      <div class="main-container">
            <header id="header">
                <div class="logo">
                    <img src={IMAGES.img1} alt="logo" width="50px" height="50px"/>
                </div>
                <div class="nav-bar">

            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/Features">Features</Link>
                        </li>
                        <li>
                            <Link to="/Explore">Explore</Link>
                        </li>
                    </ul>
                </nav>


            </div>
                </div>
                <div class="register-login-button">
                    <button class="credentials-button" type="button" onclick={handleSignInClick}>Register</button>
                </div>
            </header></div>
        </div>
  )
}

export default Nav;
